const Nav = () => {
    const navHeadings = ["About", "Knowledge", "Projects", "Contact"];
    return (
        <nav class="navbar" id="menu">
            {navHeadings.map(navHeading => {
                const navRef = `#${navHeading.toLowerCase()}`
                return <a href={navRef}>{navHeading}</a>
            })}
        </nav>
    )
}
